import React from "react";
import styled from "styled-components";
import { Wrapper } from "../styled/space";
import { Labor } from "../styled/typos";
const PopUp = props => {
  console.log(props);
  return (
    <Wrapper>
      <Container>
        <Labor>{props.content}</Labor>
      </Container>
    </Wrapper>
  );
};

export default PopUp;

const Container = styled.div`
  background-color: ${props => props.theme.colors.blue};
  position: fixed;
  z-index: 300;
  top: 0;
  left: 0;
  width: 100%;
  padding: 30px 0;
`;
